import { useState } from "react";

const handleClick = () => {};

const UseStateCounter = () => {
  const [count, setCount] = useState(1);
  return (
    <>
      <button type="button" onClick={() => setCount(count + 1)}>
        Add to count
      </button>
      <p>{count}</p>
    </>
  );
};

export default UseStateCounter;
